import React, { Component } from "react";
import Fade from "react-reveal/Fade";

class MobileBar extends Component {
  constructor(props) {
    super();

    this.state = {
      active: false
    };
  }

  render() {
    if (!this.state.active) {
      return (
        <div>
          <Fade>
            <ul className="header">
              <li className="barbutton"><a>Menu</a></li>
            </ul>
          </Fade>
        </div>
      );
    } else {
      return (
        <div>
          <Fade up>
            <div className="topbar">
              <div className="barbutton">Project</div>
            </div>
          </Fade>
        </div>
      );
    }
  }
}

export default MobileBar;
